import React from 'react';
import { NavLink } from 'react-router-dom';
import styled from 'styled-components';

const StyledWrapper = styled.nav`
  position: fixed;
  top: 0;
  width: 100%;
  max-width: 1000px;
  height: 150px;
  background-color: ${({ theme }) => theme.yellow};
  display: flex;
  align-items: center;
  justify-content: space-between;
  padding: 0 30px;
`;

const StyledLogoLink = styled(NavLink)`
  display: block;
  text-decoration: none;
  size: ${({ theme }) => theme.fontSize.l};
`;

const StyledLinksList = styled.ul`
  margin: 0;
  padding: 0;
  list-style: none;
  display: flex;
`;

const StyledLink = styled.h2`
  margin: 0;
  padding: 0;
  list-style: none;
  text-decoration: none;
  padding: 20px;
`;

const NavBar = () => (
  <StyledWrapper>
    <StyledLogoLink to="/">Olx.app</StyledLogoLink>
    <StyledLinksList>
      <li>
        <StyledLink as={NavLink} to="/">
          Homepage
        </StyledLink>
      </li>
      <li>
        <StyledLink as={NavLink} to="/posts/new">
          Add post
        </StyledLink>
      </li>
      <li>
        <StyledLink as={NavLink} to="/posts">
          See posts
        </StyledLink>
      </li>
    </StyledLinksList>
  </StyledWrapper>
);

export default NavBar;
